Fastest and most accurate followers analytics tool for Instagram. 

Key features:
- your new followers;
- your new followings;
- lost followers; 
- mutual followers;
- unanswered followers;
- unanswered followings;

and much more.

Information about the auto-renewable nature of the subscription
- Every time in a week you can reach your updated reports and if you want to continue getting reports, your subscription should be continued.
- Subscription periods are 1 month, 6 months and 12 months. Every 1, 6 and 12 months your subscription renews.
- Payment will be charged to iTunes Account at confirmation of purchase.
- The price of the subscription is 4.49 USD for 1 month; 17.99 USD for 6 months, and 23.99 USD for 12 months.
- Subscription automatically renews unless auto-renew is turned off at least 24-hours before the end of the current period.
- Account will be charged for renewal within 24-hours prior to the end of the current period.
- You can cancel your subscription via this url: https://support.apple.com/en-us/HT202039
